import React from "react";
import Iphone from "./iphone";
import Icons from "./icons";

function App() {
    return (
        <div className="root-div" onLoad="this.style.opacity=1">
            <div><Iphone/></div>
            <div><Icons/></div>
        </div>
    )
}

export default App;
